import { withProvider } from '../GlobalProvider.js';
import './navbar/MyNavbar.css';

function MyNavbar (props) {
    return ( 
        <div className="navbar">
            <Navbar fluid collapseOnSelect>
                <Navbar.Header>
                    <Navbar.Brand>
                        <Link to="/">Chatting App</Link>
                    </Navbar.Brand>
                    <Navbar.Toggle />
